import React from 'react';
import styled from "styled-components";
import "./indexpage.css";
import alltiles from './tilesfile.json'

const Tiles = styled.div`

`;

const MainIndexComponent = () => {
    return (
        <>
            <Tiles className='tile-section'>
                <h3 className='subheading-1'>Most Popular Tiles Variety</h3>
                <div className="tileImages">
                    {alltiles.map((gettile) => {
                        return (
                            <>
                                <span key={gettile.userid}></span>
                            </>
                        )
                    })}
                </div>
            </Tiles>
            {/* <section className='tiles_section'> */}
                
                {/* <div className="mainContainer">
                    <h3 className='subheading-1'>Most Popular Tiles Varity</h3>
                    <div className="tiles">
                        <div className="indextiles">
                            <img className='indexImages' src="/tilesImages/tile_1.png" alt="Tile1" />
                            <h3 className='tilesheading'>Roofing Tiles</h3>
                        </div>
                        <div className="indextiles">
                            <img className='indexImages' src="/tilesImages/tile_2.png" alt="Tile2" />
                            <h3 className='tilesheading'>Ceiling Tiles</h3>

                        </div>
                        <div className="indextiles">
                            <img className='indexImages' src="/tilesImages/tile_3.png" alt="Tile3" />
                            <h3 className='tilesheading'>Flooring Tiles</h3>

                        </div>
                        <div className="indextiles">
                            <img className='indexImages' src="/tilesImages/tile_4.png" alt="Tile4" />
                            <h3 className='tilesheading'>Wall Tiles</h3>

                        </div>
                    </div>
                </div> */}
            {/* </section> */}
        </>
    );
};

export default MainIndexComponent;
